css:
atom-text-editor .clickable-class .inherited-class,
atom-text-editor::shadow .clickable-class .inherited-class,
atom-text-editor .clickable-class .support.class,
atom-text-editor::shadow .clickable-class .support.class,
atom-text-editor .clickable-class .namespace,
atom-text-editor::shadow .clickable-class .namespace {
  cursor: pointer;
}
atom-text-editor .clickable-class .inherited-class:hover,
atom-text-editor::shadow .clickable-class .inherited-class:hover,
atom-text-editor .clickable-class .support.class:hover,
atom-text-editor::shadow .clickable-class .support.class:hover,
atom-text-editor .clickable-class .namespace:hover,
atom-text-editor::shadow .clickable-class .namespace:hover {
  text-decoration: underline;
}
.atom-php-navigation .message:after {
  content: "";
  display: table;
  clear: both;
}
.atom-php-navigation .message .loading {
  display: inline-block;
  width: 16px;
  float: right;
  height: 16px;
  background-image: url(data:image/svg+xml;base64,);
}
